import React, { useState } from 'react';
import HypertensionStudyApp from './components/Artifact';
import CVDisordersPage from './components/CVDisordersPage';

const App = () => {
  const [currentPage, setCurrentPage] = useState('hypertension');

  return (
    <div className="min-h-screen bg-gray-100">
      <nav className="bg-gray-800 text-white p-4">
        <div className="max-w-7xl mx-auto flex justify-between items-center">
          <div className="text-xl font-bold">Medical Study Guide</div>
          <div className="flex space-x-4">
            <button 
              onClick={() => setCurrentPage('hypertension')} 
              className={`px-3 py-2 rounded ${currentPage === 'hypertension' ? 'bg-blue-600' : 'hover:bg-gray-700'}`}
            >
              Hypertension
            </button>
            <button 
              onClick={() => setCurrentPage('cvdisorders')} 
              className={`px-3 py-2 rounded ${currentPage === 'cvdisorders' ? 'bg-red-600' : 'hover:bg-gray-700'}`}
            >
              CV Disorders
            </button>
          </div>
        </div>
      </nav>

      <div className="container mx-auto py-8">
        {currentPage === 'hypertension' && <HypertensionStudyApp />}
        {currentPage === 'cvdisorders' && <CVDisordersPage />}
      </div>
    </div>
  );
};

export default App;
